contracts/Quiz/Quiz5.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract Quiz5 {
    function fun1(uint a) public pure returns (bool) {
        if (a >= 11) {
            return true;
        } else {
            return false;
        }
    }
}

contracts/Quiz/Quiz6.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract Quiz7 {
    function fun1() public pure returns (uint) {
        uint result = 0;

        for (uint i = 1; i < 11; ++i) {
            result += i;
        }

        return result;
    }
}

